import React, { useState } from "react";
import { View, TextInput, Button, Text, TouchableOpacity, StyleSheet, Platform } from "react-native";
import { AntDesign } from "@expo/vector-icons";

const CadastroScreen = ({ navigation }) => {
  const [nome, setNome] = useState("");
  const [email, setEmail] = useState("");
  const [senha, setSenha] = useState("");
  const [confirma, setConfSenha] = useState("");
  const [checked, setChecked] = useState(false);

  const handleCadastro = () => {
    
    console.log("Login com", nome, email, senha);
  };

  const toggleCheckbox = () => {
    setChecked(!checked);
  };

  return (
    <View style={styles.container}>
      <AntDesign
        name="back"
        size={24}
        color="black"
        style={styles.backButton}
        onPress={() => navigation.goBack()}
      />

      <Text style={styles.title}>Preencha seus dados para criar a sua conta</Text>

      <View>
              
              <TouchableOpacity onPress={() => setIsCriarComEmail(false)}>
                <Text>Quer usar o telefone? Clique aqui.</Text>
              </TouchableOpacity>
            </View>
          
            <View>
              
              <TouchableOpacity onPress={() => setIsCriarComEmail(true)}>
                <Text>Prefere e-mail? Clique aqui.</Text>
              </TouchableOpacity>
            </View>


      <TextInput
        placeholder="Nome completo"
        value={nome}
        onChangeText={setNome}
        style={styles.input}
      />

      <TextInput
        placeholder="Email"
        value={email}
        onChangeText={setEmail}
        style={styles.input}
        keyboardType="email-address"
        autoCapitalize="none"
      />

      <TextInput
        placeholder="Senha"
        value={senha}
        onChangeText={setSenha}
        secureTextEntry
        style={styles.input}
      />

      <TextInput
        placeholder="Confirmar senha"
        value={confirma}
        onChangeText={setConfSenha}
        secureTextEntry
        style={styles.input}
      />

      <Text style={styles.warning}> Deve conter pelo menos dois dos seguintes itens: letra, número e símbolo </Text>

      <View style={styles.termsContainer}>
        <TouchableOpacity
          onPress={toggleCheckbox}
          style={[styles.checkbox, checked && styles.checked]}
        ></TouchableOpacity>

        <Text style={styles.termsText}>
          Eu li e aceito os Termos de Uso e as Políticas de Privacidade
        </Text>
      </View>

      <TouchableOpacity onPress={handleCadastro} style={styles.button}>
        <Text style={styles.text}>Continuar</Text>
      </TouchableOpacity>

    </View>
  );
};

const styles = StyleSheet.create({
  
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    paddingHorizontal: 20,
  },

  backButton: {
      alignSelf: "flex-start",
      position: "absolute",
      top: Platform.OS === "ios" ? 40 : 20, // Ajuste para iOS e Android
      left: 10,
    },

    title: {
      fontSize: 18,
      fontWeight: "bold",
      marginTop: 0,
      marginBottom: 30,
      alignSelf: "flex-start",
      top: 35
    },

    input: {
      width: "100%", // Isso faz com que o input ocupe a largura total do container
      height: 57, // Altura do input
      marginBottom: 10, // Espaço entre o input e o botão
      top: 15,
      borderWidth: 1,
      borderColor: "#ccc", // Cor da borda do input
      borderRadius: 10, // Bordas arredondadas
      paddingHorizontal: 10, // Padding interno do input
    },

    warning: {
      fontSize: 10,
      top: 13,
      marginRight: 30,
      alignItems: "center",
      color: "red"
    },

    checkbox: {
      width: 20,
      height: 20,
      borderRadius: 10,
      marginRight: 10,
      borderWidth: 1,
      borderColor: "#E5AE01",
      justifyContent: "center",
      alignItems: "center",
      top: 40,
      marginRight: 20,
    },

    termsText: {
      fontSize: 14,
      top: 20,
      marginLeft: 30,
      fontWeight: "bold",
    },

    checked: {
      backgroundColor: "#E5AE01",
    },

  button: {
    width: "100%", // Faz o botão ter a mesma largura do input
    height: 60, // Altura do botão, pode ajustar conforme necessário
    backgroundColor: "#0068C1", // Fundo azul
    justifyContent: "center", // Isso centraliza o texto no botão verticalmente
    alignItems: "center", // E isso horizontalmente
    borderRadius: 5, // Bordas arredondadas do botão
    top: 50
  },

  text: {
    color: "#fff",
    fontWeight: "bold", // Texto branco pra ficar top no botão azul
    fontSize: 18,
  },


  label: {
    fontSize: 14,
  },

  forgotPasswordText: {
    marginTop: 15,
    color: "#E5AE01",
    fontWeight: "bold",
  },

});

export default CadastroScreen;
